import React from "react";
import { NavLink } from "react-router-dom";
import Header from "../Header/Header";
import s from "./Navbar.module.css";
import { useTranslation } from "react-i18next";
import storeIcon from "../../assets/images/navbar-icons/black-shop-tag.svg"

const Navbar = () => {
  const { t } = useTranslation();
  return (
    <div className={s.nav}>
      <Header />
      <nav className={s.items}>
        <div className={`${s.item} ${s.lngShop}`}>
          <img src={storeIcon} />
          <NavLink to="/store?view" activeClassName={s.activeLink}>
            {t("nav.store")}
          </NavLink>
        </div>
        <div className={s.item}>
          <NavLink to="/library" activeClassName={s.activeLink}>
          {t("nav.library")}
          </NavLink>
        </div>
        <div className={s.item}>
          <NavLink to="/settings" activeClassName={s.activeLink}>
          {t("nav.settings")}
          </NavLink>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
